import React from 'react';

import runString from '../Images/run-string.png'

import classes from './styles.module.css';

const RunningString = () => {
    return (
        <div className={classes.container}>
            <div className={classes.one}><img src={runString} alt="/" /></div>
        </div>
    )
}

export default RunningString
